import React, { useState } from "react";

const App = () => {

    let curTime= new Date().toLocaleTimeString();

    const[cTime ,setcTime] = useState(curTime)
    return(
        <>
        <div>
            <h1>{cTime}</h1>
            <button>Get Time</button>
         </div>
        </>
    );
};

export default App;
